drop table if exists CAR_OWNERSHIP;
create table CAR_OWNERSHIP (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	owner_city VARCHAR(50),
	owner_country VARCHAR(50),
	model_year VARCHAR(50),
	make VARCHAR(50),
	model VARCHAR(50),
	automatic VARCHAR(50),
	owners INT,
	max_speed INT,
	transaction_date VARCHAR(50)
);
